import React from 'react'
import { businessLinks } from '../constants'
import style from '../style'


const Business = () => {
  return (
    <div className='bg-black font-poppins'>
      <ul className='flex md:flex-row flex-col'>
      {
        businessLinks.map((business,index) => (
          <li className='font-semibold text-[40px] text-center text-rose-700 pt-2 italic '>{business.type}
          <img src = {business.image} alt = "cuisinetype" className='lg:w-[500px] lg:h-[500px]  w-[200px] h-[200px] p-4 rounded-full'/>
          <p className={style.businessParagraph}>{business.content}</p>
          </li>
        ))
      }
      </ul>
    </div>
  )
}

export default Business
